import './App.css';
import AngleBtn from './trifles/AngleBtn';
import GreenBtn from './trifles/GreenBtn';
import GreenOval from './trifles/GreenOval';
import Back from './trifles/icons/Back';
import Heart from './trifles/icons/Heart';
import Stars from './trifles/stars/Stars';

function App() {
  return (
    <div className="App">
    <GreenOval>Cxxxxx</GreenOval>
    <GreenBtn>Mrrrrrrr</GreenBtn>
    <Stars/>
    <AngleBtn>DFdfdff</AngleBtn>
    <Back/>
    <Heart/>
    </div>
  );
}

export default App;
